const newGameButton = document.getElementById("newGame");

let gameId;

newGameButton.addEventListener("click", () => {
    fetch(`http://localhost:8080/create`)
    .then(response => response.json())
    .then(data => {
        gameId = data.gameId;
    })
    .catch(error => {
        console.error("Error:", error);
    });
});

export function getGameId(){
    return gameId;
}
